import { ContractValue } from '@l2beat/discovery-types'
import { EthereumAddress } from '@l2beat/shared-pure'
import { expect, mockObject } from 'earl'

import { DiscoveryLogger } from '../../DiscoveryLogger'
import { DiscoveryProvider } from '../../provider/DiscoveryProvider'
import { ArbitrumScheduledTransactionsHandler } from './ArbitrumScheduledTransactionsHandler'

const RETRYABLE_TICKET_MAGIC = EthereumAddress(
  '0xa723C008e76E379c55599D2E4d93879BeaFDa79C',
)

describe(ArbitrumScheduledTransactionsHandler.name, () => {
  it('returns validators from the traces that add and remove them', async () => {
    const handler = new ArbitrumScheduledTransactionsHandler(
      'scheduledTransactions',
      [
        'event CallScheduled(bytes32 indexed id, uint256 indexed index, address target, uint256 value, bytes data, bytes32 predecessor, uint256 delay)',
      ],
      DiscoveryLogger.SILENT,
    )

    const mockGetMetadata = async (address: EthereumAddress) => ({
      abi: [
        'function execute(address upgrade, bytes upgradeCallData) payable',
        'function perform() public',
        'function perform(address _securityCouncil, address[] memory _updatedMembers, uint256 _nonce) external returns (bool res)',
      ],
      isVerified: true,
      name: 'name_of_' + address.toString(),
      solidityVersion: '1.0.0',
      source: 'source_of_' + address.toString(),
    })
    handler.getRetryableTicketMagic = async () => RETRYABLE_TICKET_MAGIC
    handler.createProviderForChain = (chain: string) =>
      chain === 'nova'
        ? undefined
        : mockObject<DiscoveryProvider>({
            getMetadata: mockGetMetadata,
          })

    const provider = mockObject<DiscoveryProvider>({
      getLogs: async () => EXAMPLE_LOGS,
      getMetadata: mockGetMetadata,
    })

    const contractAddress = EthereumAddress.random()
    const response = await handler.execute(provider, contractAddress, 123456)

    expect(response).toEqual({
      field: 'scheduledTransactions',
      value: EXPECTED_DECODED_SCHEDULED_TRANSACTIONS as ContractValue,
      ignoreRelative: true,
    })
  })
})

